window.bookSummaryJSON = "<p>The siege of the Brazen City has been lifted and the Paladin Bergen remains free. Following their victory, Ahren and his companions continue on their travels, this time to the Southern Jungles in search of information regarding the whereabouts of the female Paladin, Sunju. </p> <p>The journey is long and dangerous. Not only must they traverse the Nameless Desert and the untamed primeval forest, but hired assassins are hot on their heels along the Spear Path. And to top it all, the consequences of Jelninolan's extended absence from Evergreen could be fatal to her....</p>"; 
